Content:
Tôi muốn nhượng lại suất ngoại giao căn góc cc Green Star. Căn thuộc tầng 12, tòa A3, có diện tích thông thủy là 95.9m2. Cửa vào TB , ban công ĐN- TN, view hồ điều hòa và vườn hoa, có 3 phòng ngủ . 
Thiết kế chi tiết diện tích căn hộ như sau :      
Phòng khách + ăn : 30.2m2 ; Phòng bếp : 6.8m2 ;
Phòng ngủ 1 : 15.2m2;        Phòng ngủ 2 : 11.9m2;       Phòng ngủ 3 : 12.3m2;  
WC1 : 4.3m2  ;  WC2 : 3.7m2;  	
Logia 1: 2.9m2;   Logia 2: 3.3m2.	
Do gia đình mua theo suất ngoại giao, hơn nữa đang cần tiền gấp nên giá bán có thể mềm hơn thị trường một chút.
Ai có nhu cầu liên hệ với tôi theo sđt: Chị Hữu: 0982 232 183
